import React, { Component } from "react";
import { connect } from "react-redux";
import {
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBIcon,
  MDBRating,
} from "mdbreact";

export class saloncontainer extends Component {
  render() {
    return (
      <div className="mt-5">
        <MDBRow>
          <MDBCol md="4">
            <MDBCard>
              <MDBCardImage
                src="https://mdbootstrap.com/img/Photos/Horizontal/Work/4-col/img%20%2821%29.jpg"
                overlay="white-slight"
                hover
                alt="MDBCard image cap"
              />
              <MDBCardBody className="elegant-color white-text rounded-bottom">
                <MDBCardTitle>salon name</MDBCardTitle>
                <hr className="hr-light" />
                <MDBCardText className="white-text">description</MDBCardText>
                <MDBRating iconRegular />
                <a href="#!" className="black-text d-flex justify-content-end">
                  <h5 className="white-text">
                    Découvrir et réservez
                    <MDBIcon icon="angle-double-right" className="ml-2" />
                  </h5>
                </a>
              </MDBCardBody>
            </MDBCard>
          </MDBCol>
        </MDBRow>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(saloncontainer);
